import PropTypes from 'prop-types';

class GroupTableComponent extends Component {
    constructor(props) {
        super(props);
        
        this.state ={
            journal: props.journal
        }
    }

    componentDidMount() {

    }

    render() {
        return (
            <tr>
                <td>{journal.curatorName}</td>
                <td>{journal.groupId}</td>
                <td>{journal.mouth}</td>
            </tr>
        );
    }
}

export default GroupTableComponent;
